import { Select } from "antd";

import React, { Component } from "react";
import axios from "axios";
import PropTypes from "prop-types";

const { Option } = Select;

function onChange(value) {
  console.log(`selected ${value}`);
}

function onBlur() {
  console.log("blur");
}

function onFocus() {
  console.log("focus");
}

function onSearch(val) {
  console.log("search:", val);
}

export class SelelctTenant extends Component {
  constructor() {
    super();
    this.state = {
      tenants: [],
    };
  }

  //   componentDidMount() {
  //     axios
  //       .get("http://localhost:5000/api/tenants")
  //       .then((response) => {
  //         response.
  //       })
  //       .catch((error) => {
  //         console.log(error);
  //       });
  //   }

  render() {
    return (
      <div>
        <div>
          <span>Cluster: </span>
          <Select
            showSearch
            style={{ width: 200 }}
            placeholder="Select a tenant"
            optionFilterProp="children"
            onChange={onChange}
            onFocus={onFocus}
            onBlur={onBlur}
            onSearch={onSearch}
            filterOption={(input, option) =>
              option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
            }
          >
            <Option value="jack">Jack</Option>
            <Option value="lucy">Lucy</Option>
            <Option value="tom">Tom</Option>
          </Select>
        </div>

        <div style={{ padding: "10ps" }}>
          <span>Tenant: </span>
          <Select
            showSearch
            style={{ width: 200 }}
            placeholder="Select a tenant"
            optionFilterProp="children"
            onChange={onChange}
            onFocus={onFocus}
            onBlur={onBlur}
            onSearch={onSearch}
            filterOption={(input, option) =>
              option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
            }
          >
            <Option value="jack">Jack</Option>
            <Option value="lucy">Lucy</Option>
            <Option value="tom">Tom</Option>
          </Select>
        </div>
      </div>
    );
  }
}

export default SelelctTenant;
